import React from 'react';
import './MiniCart.css';
import tee from '../../tee.jpg';

const MiniCart = () => {
	return(
		<div style={{display:'flex', 'flex-direction':'column'}}>
			<div id='MiniCart' style={{width:'auto%',height:'auto',display:'flex',justifyContent:'space-around'}}>			
				<img src={tee} />
				<div>
					<p>Classic Tee</p>
					<p>1x <strong>$75</strong></p>
					<p>Classic Tee</p>

				</div>
			</div>
			<div id='MiniCart' style={{width:'50%',height:'auto'}}>
				<p>this is mini cart</p>
				<img src={tee} />
			</div>
		</div>
	)
}

export default MiniCart;
